(162, 'Туалетний папір', '1.	Централізована бібліотечна система «Свічадо» (вул. Зодчих, 30/6)); сума – 13350 грн.\n•	Папір туалетний типу «Zeva», білий, трьохшаровий, 16 рул./уп. – 35 уп.\n•	Паперові рушники, целюлоза, Z-подібного типу складення,  2-х шарові, 21*22 см,                                160 листів/уп. – 200 уп.\n\n\n2. Київська дитяча художня школа №5 (вул. Стуса, 25); сума – 600 грн.\n•	Папір туалетний «Обухів», 65 м. – 100 рул.\n\n3. Київська дитяча школа мистецтв №8 (вул. Ф. Пушиної, 6); 2100 грн.\n•	Папір туалетний «Обухів», 65 м. – 150 рул.\n•	Паперові рушники, целюлоза, Z-подібного типу складення,  2-х шарові, 21*22 см,                              160 листів/уп. – 40 уп.\n\n        4. Київська дитяча музична школа №22 (вул. Зодчих, 30-А); сума – 2100 грн.\n•	    Папір туалетний «Обухів», 65 м. – 300 рул.\n\n  5. Київська дитяча музична школа №23 (проспект Л. Курбаса, 10-Є); сума – 2500 грн.\n•	    Папір туалетний «Обухів», 65 м. – 500 рул.\n\n   6. Київська дитяча музична школа №29 (проспект Л. Курбаса, 7-Г); сума – 200 грн.\n•	    Папір туалетний «Обухів», 65 м. – 50 рул.\n\nКількість товарів:  1375 шт.\nМісце поставки товарів: \nВідповідно до вказаних адрес:\n1.	Централізована бібліотечна система «Свічадо» (вул. Зодчих, 30/6):\n2.	Київська дитяча художня школа №5 (вул. Стуса, 25):\n3.	Київська дитяча школа мистецтв №8 (вул. Ф. Пушиної, 6):\n4.	Київська дитяча музична школа №22 (вул. Зодчих, 30-А):\n5.	Київська дитяча музична школа №23 (проспект Л. Курбаса, 10-Є):\n6.	Київська дитяча музична школа №29 (проспект Л. Курбаса, 7-Г):\n\nСтрок поставки товарів: травень-вересень 2019 рік', 'UA-2019-04-17-000426-b', 162, 162, NULL, 1556020760, 162, NULL, 162, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'e-tender.biz', NULL, 'active.qualification', NULL, NULL, NULL, NULL),
